  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer shows selected streamflow
  gaging stations of the United States, Puerto Rico, and the U.S. Virgin Islands,
  in 2013. Gaging stations, or gages, measure the height (stage) and volume of flow
  at a point location on a water feature. Gages in this map layer were drawn from
  the National Hydrography Dataset Plus (NHDPlus) Version 1 Stream Gage Events, NHDPlus
  Version 2 National Data - Gage Locations, and from the National Water Information
  System (NWIS) Web Interface. The gage positions were adjusted (snapped) using ArcGIS
  so that the gages were located directly on streams in the National Atlas map layer,
  1:1,000,000-Scale Streams of the United States. The gages and streams also share
  attributes that link them together.\",\n\t\"license_title\": null,\n\t\"extras\":
